}

function Project(props) {
    return (
        <div className="myproject">
            <div>
                <img 
                src={props.imgUrl} 
                alt="project" 
                style={Style.picture}/>
            </div>
            <div>
            <Chips />
            </div>


        </div>
    );
}

export default Project
